import React from 'react'
import { useState } from 'react'
import './card.css'
const pro=[
    {
        id:1,
        title:"Adisa bag",
        brand:"ADISA",
        image:"data:image/jpeg;base64,",
        price:2000,
        count:0
    },
    {
        id:2,
        title:"Skybags",
        brand:"SKYBAGS",
        image:"data:image/jpeg;base64,",
        price:1500,
        count:0
    },
    {
        id:3,
        title:"Aircraft bags",
        image:"data:image/jpeg;base64,",
        brand:"AIRCRAFT",
        price:1000,
        count:0
    }

]
export default function Bags() {
    const [quan,setQuan]=useState(0);
    const inc=()=>{
        setQuan(quan+1);
    };
    const dec=()=>{
        if(quan>=1)
        setQuan(quan-1);
    };
    const fun =(item,quan)=>{
        if(quan)
        {
        alert('Added to wishlist');
        item.count+=quan;
        localStorage.setItem(item.id,JSON.stringify(item))
        }
    };
  return (
    <>
    <h2>Bags</h2>
    <div className='box-1'>
    {
        pro.map((item)=>(
            <div className='category' >
            <h3>{item.title}</h3>
            <img src={item.image} alt='img'/>
            <h3>{item.brand}</h3>
            <h4>₹{item.price}</h4>
            <button className='btn-card' onClick={()=>fun(item,fun)}>Add to Cart</button>
            <br></br>
            <button className='btn-card' onClick={inc}>+</button>
            <span>{quan}</span>
            <button className='btn-card' onClick={dec}>-</button>
            </div>  
             )
        )
    } 
  </div>
  </>
  )
}

